namespace PPI\Framework\Debug;

use PPI\Framework\Http\Response;
use Symfony\Component\Debug\Exception\FlattenException;
use Symfony\Component\Debug\ExceptionHandler as BaseExceptionHandler;

if (!defined('ENT_SUBSTITUTE')) {
    define('ENT_SUBSTITUTE', 8);
}

/**
 * ExceptionHandler converts an exception to a Response object.
 *
 * It is mostly useful in debug mode to replace the default PHP/XDebug
 * output with something prettier and more useful.
 *
 * As this class is mainly used during App boot, where nothing is yet
 * available, the Response content is always HTML.
 *
 * @author Fabien Potencier <fabien@symfony.com>
 * @author Vítor Brandão <vitor@ppi.io>
 * @author Paul Dragoonis <paul@ppi.io>
 */
class ExceptionHandler extends BaseExceptionHandler
{
    private $debug;
    private $charset;
    private $appName;
    private $appVersion;
    private $showAllExceptions;

    /**
     * @param bool   $debug
     * @param string $charset
     * @param string $appName
     * @param string $appVersion
     */
    public function __construct($debug = true, $charset = 'UTF-8', $appName = 'PPI Framework', $appVersion = null, $showAllExceptions = false)
    {
        $this->debug             = $debug;
        $this->charset           = $charset;
        $this->appName           = $appName;
        $this->appVersion        = $appVersion;
        $this->showAllExceptions = $showAllExceptions;
    }

    /**
     * @param $appName
     *
     * @return $this
     */
    public function setAppName($appName)
    {
        $this->appName = $appName;

        return $this;
    }

    /**
     * @param $appVersion
     *
     * @return $this
     */
    public function setAppVersion($appVersion)
    {
        $this->appVersion = $appVersion;

        return $this;
    }

    /**
     * Registers the exception handler.
     *
     * @param bool $debug
     *
     * @return ExceptionHandler The registered exception handler
     */
    public static function register($debug = true, $charset = null, $fileLinkFormat = null)
    {
        $handler = new static($debug, $charset, $fileLinkFormat);

        set_exception_handler(array($handler, 'handle'));

        return $handler;
    }

    /**
     * Sends a response for the given Exception.
     *
     * If you have the PPI Http component installed,
     * this method will use it to create and send the response. If not,
     * it will fallback to plain PHP functions.
     *
     * @param \Exception $exception An \Exception instance
     *
     * @see sendPhpResponse
     * @see createResponse
     */
    public function handle(\Exception $exception)
    {

        // We need to make sure there are output buffers before we try to clean
        $status = ob_get_status();
        if (!empty($status)) {
            ob_clean();
        }

        if (class_exists('PPI\Framework\Http\Response')) {
            $this->createResponse($exception)->send();
        } else {
            $this->sendPhpResponse($exception);
        }
    }

    /**
     * Sends the error associated with the given Exception as a plain PHP response.
     *
     * This method uses plain PHP functions like header() and echo to output
     * the response.
     *
     * @param \Exception|FlattenException $exception An \Exception instance
     */
    public function sendPhpResponse($exception)
    {
        if (!$exception instanceof FlattenException) {
            $exception = FlattenException::create($exception);
        }

        header(sprintf('HTTP/1.0 %s', $exception->getStatusCode()));
        foreach ($exception->getHeaders() as $name => $value) {
            header($name . ': ' . $value, false);
        }

        echo $this->decorate($this->getContent($exception, $this->showAllExceptions), $this->getStylesheet($exception));
    }

    /**
     * Creates the error Response associated with the given Exception.
     *
     * @param \Exception|FlattenException $exception An \Exception instance
     *
     * @return Response A Response instance
     */
    public function createResponse($exception)
    {
        if (!$exception instanceof FlattenException) {
            $exception = FlattenException::create($exception);
        }

        return new Response($this->decorate($this->getContent($exception, $this->showAllExceptions), $this->getStylesheet($exception)), $exception->getStatusCode(), $exception->getHeaders());
    }

    /**
     * Gets the HTML content associated with the given exception.
     *
     * @param FlattenException $exception A FlattenException instance
     * @param bool             $showAll   SA
     *
     * @return string The content as a string
     */

    /**
     * Gets the HTML content associated with the given exception.
     *
     * @param FlattenException $exception A FlattenException instance
     * @param bool             $showAll   Show all exceptions or just the last one
     *
     * @return string The content as a string
     */
    public function getContent(FlattenException $exception, $showAll = true)
    {
        switch ($exception->getStatusCode()) {
            case 404:
                $title = "The page you are looking for could not be found";
                break;
            default:
                $title = "Oh noes, something's broken";
        }

        $content = '';
        if ($this->debug) {
            try {
                $exceptions = $exception->toArray();
                if (false === $showAll) {
                    $exceptions = array_slice($exceptions, -1, 1);
                    $count      = 1;
                    $total      = 1;
                } else {
                    $count = count($exception->getAllPrevious());
                    $total = $count + 1;
                }

                foreach ($exceptions as $position => $e) {
                    $i       = 0;
                    $class   = $this->abbrClass($e['class']);
                    $message = nl2br($e['message']);

                    if (false === $showAll) {
                        $content .= sprintf(<<<EOT
                        <div>
                            <h3 class="alert alert-error">%s: %s</h3>
                        </div>
EOT
                            , $class, $message);
                    } else {
                        $ind = $count - $position + 1;
                        $content .= sprintf(<<<EOT
                        <div>
                            <h3 class="alert alert-error">%d/%d %s: %s</h3>
                        </div>
EOT
                            , $ind, $total, $class, $message);
                    }

                    $content .= <<<EOT
                        <div>
                            <table class="table table-bordered table-striped"><tbody>
EOT;

                    foreach ($e['trace'] as $trace) {
                        $i++;
                        $content .= '       <tr><td>' . $i . '</td><td>';
                        if ($trace['function']) {
                            $content .= sprintf('at %s%s%s(%s)', $this->abbrClass($trace['class']), $trace['type'], $trace['function'], $this->formatArgs($trace['args']));
                        }
                        if (isset($trace['file']) && isset($trace['line'])) {
                            if ($linkFormat = ini_get('xdebug.file_link_format')) {
                                $link = str_replace(array('%f', '%l'), array($trace['file'], $trace['line']), $linkFormat);
                                $content .= sprintf(' in <a href="%s" title="Go to source">%s line %s</a>', $link, $trace['file'], $trace['line']);
                            } else {
                                $content .= sprintf(' in %s line %s', $trace['file'], $trace['line']);
                            }
                        }
                        $content .= "</td</tr>\n";
                    }

                    $content .= "    </tbody></table>\n</div>\n";
                }
            } catch (\Exception $e) {
                // something nasty happened and we cannot throw an exception anymore
                if ($this->debug) {
                    $title = sprintf('Exception thrown when handling an exception (%s: %s)', get_class($exception), $exception->getMessage());
                } else {
                    $title = "Uh oh something's broken";
                }
            }
        }

        list($quote, $author) = $this->getQuote();
        $statusCode           = $exception->getStatusCode();
        $ppiLogo              = $this->getPpiLogo();

        return <<<EOF
            <div class="page-header well">
                <h1 title="An exception has occurred - Code $statusCode"><img src="$ppiLogo" height="56" width="89">&nbsp;$title.</h1>
                <p class="muted quote"><i>"$quote"</i> &mdash; $author</p>
            </div>
            <div class="ppi-container well">
                $content
            </div>
EOF;
    }

    /**
     * Gets the stylesheet associated with the given exception.
     *
     * @param FlattenException $exception A FlattenException instance
     *
     * @return string The stylesheet as a string
     */
    public function getStylesheet(FlattenException $exception)
    {
        $ppiBackgroundImage = $this->getPpiBackgroundImage();

        return <<<EOT
            html, body { height: 100%; }
            body { background-image: $ppiBackgroundImage; }
            a { color: #406C6C; }
            #wrap { min-height: 100%; height: auto !important; height: 100%; margin: 0 auto -70px; }
            #push, #footer { height: 70px; }
            #footer { background-color: #f5f5f5; }
            @media (max-width: 767px) {
                #footer { margin-left: -20px; margin-right: -20px; padding-left: 20px; padding-right: 20px; }
            }
            .container { width: auto; max-width: 90% }
            .container .credit { margin: 20px 0; }
            .page-header { color: #244D4D; background: #E1EDED; }
            .ppi-container { background-color: #f5f5f5; color: #444; }
EOT;
    }

    private function decorate($content, $css)
    {
        $baseStylesheet = $this->getBaseStylesheet();
        $baseJavascript = $this->getBaseJavascript();
        $appName        = $this->appName;
        $appVersion     = $this->appVersion ? $this->appVersion : '2';

        return <<<EOF
<!DOCTYPE html>
<html>
    <head>
        <meta charset="utf-8">
        <meta name="robots" content="noindex,nofollow" />
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
        <title>An exception has occurred | $appName $appVersion</title>
        <meta name="description" content="PPI Skeleton Project">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <style>
$baseStylesheet
$css
        </style>
    </head>
    <body>
        <div id="wrap">
            <div class="container">
                $content
            </div>
            <div id="push"></div>
        </div>
        <div id="footer">
            <div class="container">
                <p class="muted credit"><a href="http://ppi.io" class="btn btn-small"><b>$appName $appVersion</b></a>&nbsp;
                App crashed and not your fault? <a href="https://github.com/ppi/framework/issues/new">Blame us</a>.
                It's your fault but don't know how to fix it? <a href="http://www.ppi.io/chat">Chat with the PPI community</a>.
                Don't wanna fix it? <a href="http://dynamic.xkcd.com/random/comic/">Procrastinate</a>.</p>
            </div>
        </div>
        <script>
        $baseJavascript
        $("abbr").tooltip();
        </script>
    </body>
</html>
EOF;
    }

    private function abbrClass($class)
    {
        $parts = explode('\\', $class);

        return sprintf("<abbr title=\"%s\">%s</abbr>", $class, array_pop($parts));
    }

    /**
     * Formats an array as a string.
     *
     * @param array $args The argument array
     *
     * @return string
     */
    private function formatArgs(array $args)
    {
        $result = array();
        foreach ($args as $key => $item) {
            if ('object' === $item[0]) {
                $formattedValue = sprintf("<em>object</em>(%s)", $this->abbrClass($item[1]));
            } elseif ('array' === $item[0]) {
                $formattedValue = sprintf("<em>array</em>(%s)", is_array($item[1]) ? $this->formatArgs($item[1]) : $item[1]);
            } elseif ('string'  === $item[0]) {
                $formattedValue = sprintf("'%s'", htmlspecialchars($item[1], ENT_QUOTES | ENT_SUBSTITUTE, $this->charset));
            } elseif ('null' === $item[0]) {
                $formattedValue = '<em>null</em>';
            } elseif ('boolean' === $item[0]) {
                $formattedValue = '<em>' . strtolower(var_export($item[1], true)) . '</em>';
            } elseif ('resource' === $item[0]) {
                $formattedValue = '<em>resource</em>';
            } else {
                $formattedValue = str_replace("\n", '', var_export(htmlspecialchars((string) $item[1], ENT_QUOTES | ENT_SUBSTITUTE, $this->charset), true));
            }

            $result[] = is_int($key) ? $formattedValue : sprintf("'%s' => %s", $key, $formattedValue);
        }

        return implode(', ', $result);
    }

    private function getPpiLogo()
    {
        return <<<'EOT'
data:image/png;base64,
EOT;
    }

    private function getPpiBackgroundImage()
    {
        return <<<'EOT'
url(data:image/png;base64,);
EOT;
    }

