    private function getQuote()
    {
        $quotes = array(
            array('The Web is broken and it\'s all your fault.', 'Rasmus Lerdorf'),
            array('If the automobile had followed the same development cycle as the computer, a Rolls-Royce would today cost $100, get a million miles per gallon, and explode once a year, killing everyone inside.', 'Robert X. Cringely'),
            array('Most software today is very much like an Egyptian pyramid with millions of bricks piled on top of each other, with no structural integrity, but just done by brute force and thousands of slaves.', 'Alan Kay'),
            array('I\'ve finally learned what "upward compatible" means.  It means we get to keep all our old mistakes.', 'Dennie van Tassel'),
            array('There are two major products that come out of Berkeley: LSD and UNIX.  We don\'t believe this to be a coincidence.', 'Jeremy S. Anderson'),
            array('19 Jan 2038 at 3:14:07 AM', 'End of the word according to Unix–2^32 seconds after January 1, 1970'),
            array('The Internet? Is that thing still around?', 'Homer Simpson'),
            array('The Web is like a dominatrix.  Everywhere I turn, I see little buttons ordering me to Submit.', 'Nytwind'),
            array('Come to think of it, there are already a million monkeys on a million typewriters, and Usenet is nothing like Shakespeare.', 'Blair Houghton'),
            array('Programmers are in a race with the Universe to create bigger and better idiot-proof programs, while the Universe is trying to create bigger and better idiots.  So far the Universe is winning.', 'Rich Cook'),
            array('Most of you are familiar with the virtues of a programmer.  There are three, of course: laziness, impatience, and hubris.', 'Larry Wall'),
            array('The trouble with programmers is that you can never tell what a programmer is doing until it\'s too late.', 'Seymour Cray'),
            array('That\'s the thing about people who think they hate computers.  What they really hate is lousy programmers.', 'Larry Niven'),
            array('For a long time it puzzled me how something so expensive, so leading edge, could be so useless.  And then it occurred to me that a computer is a stupid machine with the ability to do incredibly smart things, while computer programmers are smart people with the ability to do incredibly stupid things.  They are, in short, a perfect match.', 'Bill Bryson'),
            array('Computer science education cannot make anybody an expert programmer any more than studying brushes and pigment can make somebody an expert painter.', 'Eric Raymond'),
            array('A programmer is a person who passes as an exacting expert on the basis of being able to turn out, after innumerable punching, an infinite series of incomprehensive answers calculated with micrometric precisions from vague assumptions based on debatable figures taken from inconclusive documents and carried out on instruments of problematical accuracy by persons of dubious reliability and questionable mentality for the avowed purpose of annoying and confounding a hopelessly defenseless department that was unfortunate enough to ask for the information in the first place.', 'IEEE Grid newsmagazine'),
            array('A hacker on a roll may be able to produce–in a period of a few months–something that a small development group (say, 7-8 people) would have a hard time getting together over a year.  IBM used to report that certain programmers might be as much as 100 times as productive as other workers, or more.', 'Peter Seebach'),
            array('The best programmers are not marginally better than merely good ones.  They are an order-of-magnitude better, measured by whatever standard: conceptual creativity, speed, ingenuity of design, or problem-solving ability.', 'Randall E. Stross'),
            array('A great lathe operator commands several times the wage of an average lathe operator, but a great writer of software code is worth 10,000 times the price of an average software writer.', 'Bill Gates'),
            array('Don\'t worry if it doesn\'t work right.  If everything did, you\'d be out of a job.', 'Mosher\'s Law of Software Engineering'),
            array('Measuring programming progress by lines of code is like measuring aircraft building progress by weight.', 'Bill Gates'),
            array('Writing code has a place in the human hierarchy worth somewhere above grave robbing and beneath managing.', 'Gerald Weinberg'),
            array('First learn computer science and all the theory.  Next develop a programming style.  Then forget all that and just hack.', 'George Carrette'),
            array('First, solve the problem. Then, write the code.', 'John Johnson'),
            array('Optimism is an occupational hazard of programming; feedback is the treatment.', 'Kent Beck'),
            array('To iterate is human, to recurse divine.', 'L. Peter Deutsch'),
            array('The best thing about a boolean is even if you are wrong, you are only off by a bit.', 'Unknown'),
            array('Should array indices start at 0 or 1?  My compromise of 0.5 was rejected without, I thought, proper consideration.', 'Stan Kelly-Bootle'),
            array('Any code of your own that you haven\'t looked at for six or more months might as well have been written by someone else.', 'Eagleson\'s Law'),
            array('The first 90% of the code accounts for the first 90% of the development time.  The remaining 10% of the code accounts for the other 90% of the development time.', 'Tom Cargill'),
            array('As soon as we started programming, we found to our surprise that it wasn\'t as easy to get programs right as we had thought.  Debugging had to be discovered.  I can remember the exact instant when I realized that a large part of my life from then on was going to be spent in finding mistakes in my own programs.', 'Maurice Wilkes discovers debugging, 1949'),
            array('Debugging is twice as hard as writing the code in the first place.  Therefore, if you write the code as cleverly as possible, you are–by definition–not smart enough to debug it.', 'Brian Kernighan'),
            array('If debugging is the process of removing bugs, then programming must be the process of putting them in.', 'Edsger W. Dijkstra'),
            array('Programming is like sex: one mistake and you\'re providing support for a lifetime.', 'Michael Sinz'),
            array('To err is human, but to really foul things up you need a computer.', 'Paul Ehrlich'),
            array('A computer lets you make more mistakes faster than any invention in human history–with the possible exceptions of handguns and tequila.', 'Mitch Radcliffe'),
            array('In order to understand recursion, one must first understand recursion.', 'Unknown'),
            array('I have always wished for my computer to be as easy to use as my telephone; my wish has come true because I can no longer figure out how to use my telephone.', 'Bjarne Stroustrup'),
            array('A SQL query walks into a bar. He approaches two tables and says, "Mind if I join you?"', 'Anonymous'),
            array('Some people, when confronted with a problem, think "I know, I\'ll use regular expressions". Now they have two problems.', 'Jamie Zawinski'),
            array('If you torture the data enough, it will confess.', 'Ronald Coase'),
            array('I love deadlines. I like the whooshing sound they make as they fly by.', 'Douglas Adams'),
            array('Debugging is like farting – it’s not so bad when it’s your own code.', 'Unknown'),
            array('Confidence, n.: The feeling you have before you understand the situation', 'Unknown'),
            array('Now I\'m a pretty lazy person and am prepared to work quite hard in order to avoid work.', 'Martin Fowler'),
            array('Get it right. Then get it fast.', 'Steve McConnell'),
            array('Q: How many prolog programmers does it take to change a lightbulb? A: Yes', 'Unknown'),
        );

        return $quotes[array_rand($quotes, 1)];
    }
}
